description:
Ninjas battle Vampires for the fate of the world in this all new Action-Horror-Comedy from the creators of 2010's cult smash, &quot;Ninjas Vs Zombies&quot;! Moments after down-on-his-luck Aaron is rejected by the girl of his dreams, they both are attacked by blood sucking VAMPIRES. Driven to save her, Aaron tracks down the mysterious NINJAS, who wage a nightly war against the forces of darkness. Now, as the Vampire overlord Seth plots to destroy Mankind, Aaron has only one choice - join the ninjas, save the world, and get the girl... or die trying. Sexy, funny, shocking, and fun, NINJAS VS VAMPIRES delivers an action-packed comedic adventure unlike any other!

